BEGIN TRANSACTION;
CREATE TABLE "cups" (
	"cup_id" TEXT NOT NULL,
	"cup_name" TEXT,
	"year" INTEGER,
	"formal" INTEGER,
	"official" INTEGER,
	PRIMARY KEY ("cup_id")
);
CREATE TABLE "teams" (
	"team_id" TEXT NOT NULL,
	"team_name" TEXT,
	PRIMARY KEY ("team_id")
);
CREATE TABLE "games" (
	"game_id" TEXT NOT NULL,
	"cup_id" TEXT,
	"time" TEXT,
	"home_team_id" TEXT,
	"home_score" INTEGER,
	"home_ipouts" INTEGER,
	"away_team_id" TEXT,
	"away_score" INTEGER,
	"away_ipouts" INTEGER,
	"grassfield" INTEGER,
	"mvp" TEXT,
	PRIMARY KEY ("game_id"),
	CONSTRAINT "cupgame" FOREIGN KEY ("cup_id") REFERENCES "cups" ("cup_id") ON UPDATE SET NULL ON DELETE SET NULL,
	CONSTRAINT "teamgame" FOREIGN KEY ("home_team_id") REFERENCES "teams" ("team_id") ON UPDATE SET NULL ON DELETE SET NULL,
	CONSTRAINT "teamgame1" FOREIGN KEY ("away_team_id") REFERENCES "teams" ("team_id") ON UPDATE SET NULL ON DELETE SET NULL
);
CREATE TABLE "players" (
	"player_id" TEXT NOT NULL,
	"player_fname" TEXT,
	"player_lname" TEXT,
	"active" INTEGER,
	"member" INTEGER,
	PRIMARY KEY ("player_id")
);
CREATE TABLE "battings" (
	"game_id" TEXT NOT NULL,
	"player_id" TEXT NOT NULL,
	"team_id" TEXT NOT NULL,
	"AB" INTEGER,
	"R" INTEGER,
	"H" INTEGER,
	"B2" INTEGER,
	"B3" INTEGER,
	"HR" INTEGER,
	"RBI" INTEGER,
	"BB" INTEGER,
	"SO" INTEGER,
	"IBB" INTEGER,
	"SF" INTEGER,
	"E" INTEGER,
	"GIDP" INTEGER,
	"order" INTEGER NOT NULL,
	PRIMARY KEY ("game_id", "player_id", "team_id", "order"),
	CONSTRAINT "gamebatting" FOREIGN KEY ("game_id") REFERENCES "games" ("game_id") ON UPDATE SET NULL ON DELETE SET NULL,
	CONSTRAINT "playerbatting" FOREIGN KEY ("player_id") REFERENCES "players" ("player_id") ON UPDATE SET NULL ON DELETE SET NULL,
	CONSTRAINT "teambatting" FOREIGN KEY ("team_id") REFERENCES "teams" ("team_id") ON UPDATE SET NULL ON DELETE SET NULL
);





CREATE TABLE "positions" (
	"POS" TEXT NOT NULL,
	"pos_num" INTEGER,
	"field" TEXT,
	PRIMARY KEY ("POS")
);


CREATE TABLE "fieldings" (
	"game_id" TEXT NOT NULL,
	"player_id" TEXT NOT NULL,
	"team_id" TEXT NOT NULL,
	"POS" TEXT NOT NULL,
	"InnOuts" INTEGER,
	"PO" INTEGER,
	"A" INTEGER,
	"E" INTEGER,
	"K" INTEGER,
	PRIMARY KEY ("game_id", "player_id", "team_id", "POS"),
	CONSTRAINT "gamefielding" FOREIGN KEY ("game_id") REFERENCES "games" ("game_id") ON UPDATE SET NULL ON DELETE SET NULL,
	CONSTRAINT "playerfielding" FOREIGN KEY ("player_id") REFERENCES "players" ("player_id") ON UPDATE SET NULL ON DELETE SET NULL,
	CONSTRAINT "positionfielding" FOREIGN KEY ("POS") REFERENCES "positions" ("POS") ON UPDATE SET NULL ON DELETE SET NULL,
	CONSTRAINT "teamfielding" FOREIGN KEY ("team_id") REFERENCES "teams" ("team_id") ON UPDATE SET NULL ON DELETE SET NULL
);

CREATE TABLE "pitchings" (
	"game_id" TEXT NOT NULL,
	"player_id" TEXT NOT NULL,
	"team_id" TEXT NOT NULL,
	"W" INTEGER,
	"L" INTEGER,
	"SV" INTEGER,
	"IPouts" INTEGER,
	"H" INTEGER,
	"ER" INTEGER,
	"HR" INTEGER,
	"BB" INTEGER,
	"SO" INTEGER,
	"BAOpp" INTEGER,
	"IBB" INTEGER,
	"R" INTEGER,
	"order" INTEGER,
	PRIMARY KEY ("game_id", "player_id", "team_id"),
	CONSTRAINT "gamepitching" FOREIGN KEY ("game_id") REFERENCES "games" ("game_id") ON UPDATE SET NULL ON DELETE SET NULL,
	CONSTRAINT "playerpitching" FOREIGN KEY ("player_id") REFERENCES "players" ("player_id") ON UPDATE SET NULL ON DELETE SET NULL,
	CONSTRAINT "teampitching" FOREIGN KEY ("team_id") REFERENCES "teams" ("team_id") ON UPDATE SET NULL ON DELETE SET NULL
);

CREATE TABLE "schema_migrations" ("version" varchar NOT NULL);
CREATE TABLE "namecards" ("id" SERIAL PRIMARY KEY NOT NULL, "name" varchar, "tel" varchar, "address" varchar, "company" varchar, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE TABLE "users" ("id" SERIAL PRIMARY KEY NOT NULL, "email" varchar DEFAULT '' NOT NULL, "encrypted_password" varchar DEFAULT '' NOT NULL, "reset_password_token" varchar, "reset_password_sent_at" timestamp, "remember_created_at" timestamp, "sign_in_count" integer DEFAULT 0 NOT NULL, "current_sign_in_at" timestamp, "last_sign_in_at" timestamp, "current_sign_in_ip" varchar, "last_sign_in_ip" varchar, "created_at" timestamp, "updated_at" timestamp, "username" varchar);
CREATE TABLE "information" ("id" SERIAL PRIMARY KEY NOT NULL, "date" date, "description" text, "is_public" boolean, "created_at" timestamp NOT NULL, "updated_at" timestamp NOT NULL);
CREATE INDEX "battingplayer_id" ON "battings" (
	"player_id" ASC
);
CREATE INDEX "battingteam_id" ON "battings" (
	"team_id" ASC
);
CREATE INDEX "game_id" ON "battings" (
	"game_id" ASC
);
CREATE INDEX "cup_id" ON "cups" (
	"cup_id" ASC
);
CREATE INDEX "fieldinggame_id" ON "fieldings" (
	"game_id" ASC
);
CREATE INDEX "fieldingteam_id" ON "fieldings" (
	"team_id" ASC
);
CREATE INDEX "player_id" ON "fieldings" (
	"player_id" ASC
);
CREATE INDEX "game_id_1" ON "games" (
	"game_id" ASC
);
CREATE INDEX "gamecup_id" ON "games" (
	"cup_id" ASC
);
CREATE INDEX "pitchinggame_id" ON "pitchings" (
	"game_id" ASC
);
CREATE INDEX "pitchingplayer_id" ON "pitchings" (
	"player_id" ASC
);
CREATE INDEX "pitchingteam_id" ON "pitchings" (
	"team_id" ASC
);
CREATE INDEX "player_id_1" ON "players" (
	"player_id" ASC
);
CREATE INDEX "team_id" ON "teams" (
	"team_id" ASC
);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
CREATE UNIQUE INDEX "index_users_on_email" ON "users" ("email");
CREATE UNIQUE INDEX "index_users_on_reset_password_token" ON "users" ("reset_password_token");
COMMIT;
